import './showcase.scss';

export default function Showcase({ data }) {
    return (
        <>
        <h1>{data.title}</h1>
        <div className='showCase'>
            <div className='left'></div>
            <div className="right">
                <h2>Détails</h2>
                <hr />
                <p>{data.details}</p>
                <h2>Téchnologies utilisées</h2>
                <ul>
                    {data.technologies.map((item, index)=>(
                        <li>{item}</li>
                    ))}
                </ul>
            </div>
        </div>
        </>
    )
}
